declare module 'vue-router' {
interface RouteMeta {
requiresAuth?: boolean
}
} // 比如给每个路由增加认证机制

路由的定义可能值包含其中几个属性，如：
{ path: '/user', component: xxx }
经过解析后得到右边的完整结构

{query?, hash?}|
({path: string} | {name?, params?})
{replace?, force?,state?} 即
可能结构：
1. {query?, hash?, path, replace?, force?,state?}
2. {query?,hash?,name?,params?,replace?,force?,state?}
